import React from "react";
import Layout from "../components/Layout";
import PrivacyPolicyForm from "./components/PrivacyForm";

const PrivacyPolicyPage = () => {
  return (
    <Layout>
      <div className="dashboard">
        <PrivacyPolicyForm />
      </div>
    </Layout>
  );
};

export default PrivacyPolicyPage;
